import React from "react";

const FileUpload = ({ onUpload }) => {
  return (
    <div className="mb-2">
      <input
        type="file"
        multiple
        accept=".txt,.pdf,.docx,.pptx,.json,.md"
        onChange={(e) => onUpload([...e.target.files])}
        className="text-sm text-slate-300"
      />
    </div>
  );
};

export default FileUpload;
